    // Exibe um número de 0 a 99 nos displays 0-1 ou 4-5
    void mostra_display(int numero, int posicao) {
        if (numero < 0 || numero > 99 || (posicao != 1 && posicao != 2)) return;

        int dezena = numero / 10;
        int unidade = numero % 10;

        uint32_t valor = 0;

        if (posicao == 1) {
            // Display 0: unidade (bits 0-7), Display 1: dezena (bits 8-15)
            valor = (dec_to_7seg[dezena] << 8) | dec_to_7seg[unidade];
            *HEX_BASE = (*HEX_BASE & 0xFFFF0000) | valor;
        } else if (posicao == 2) {
            // Display 0: unidade (bits 0-7), Display 1: dezena (bits 8-15)
            valor = (dec_to_7seg[dezena] << 8) | dec_to_7seg[unidade];
            *HEX_BASE_2 = (*HEX_BASE_2 & 0xFFFF0000) | valor;
        }
        *HEX_BASE = (*HEX_BASE & 0x0000FFFF) | (0x00000040 << 16) | (0x00000040 << 24); // Acende só o traço do meio no display HEX2
    }

    uint16_t TELA[TAMANHO_MUNDO_X * TAMANHO_MUNDO_Y];

    int botaoApertado(int num_botao) {
        return *pointer_botoes & num_botao;
    }

    void escreveTela(){
        for(int i=0; i < TAMANHO_MUNDO_X; i++){
            for(int j=0; j < TAMANHO_MUNDO_Y; j++){
                ppix[i + (j*512)] = TELA[i + (j*TAMANHO_MUNDO_X)];
            }
        }
    }

    void delay() {
        volatile int count = 0;
        for (count = 0; count < 1000000; count++) {}
    }

    void setPix(int lin, int col, uint16_t cor){
        if( lin<0 || lin>TAMANHO_MUNDO_X){
            return;
        }
        if(col<0 || col>TAMANHO_MUNDO_Y){
            return;
        }
        TELA[lin + (col*TAMANHO_MUNDO_X )] = cor;
    }

    void tile (int x0, int y0, int x1, int y1, uint16_t cor){ 
        if (x0 > x1){ int aux = x0; x0 = x1; x1 = aux; }
        if (y0 > y1){ int aux = y0; y0 = y1; y1 = aux; }
        for(int i = x0; i < x1; i++){
            for(int j = y0; j < y1; j++){
                setPix(i,j,cor);
            }
        }
    }

    void fundo (){
        // Desenha fundo com suporte a transparência
        for(int i=0; i < TAMANHO_MUNDO_X; i++){
            for(int j=0; j < TAMANHO_MUNDO_Y; j++){
                uint16_t cor_pixel = Fundo01[i + (j*TAMANHO_MUNDO_X)];
                
                // Só desenha se não for a cor transparente
                setPix(i, j, cor_pixel);
                // Se for TRANSPARENTE (0xF8FF), não desenha nada (mantém o fundo)
            }
        }
    }

    typedef struct Entidade {
        int posicaoX;
        int posicaoY;
        int velX;
        int velY;
        uint16_t *sprite;
        int tamanhoSpriteX;
        int tamanhoSpriteY;
    }Entidade;

    void desenharEntidade(Entidade* entidade){
        if(entidade->sprite == NULL){
            tile(entidade->posicaoX-5, entidade->posicaoY-5, entidade->posicaoX + 5, entidade->posicaoY + 5, RED);
            return;
        }
        
        // Desenha sprite com suporte a transparência
        for(int i=0; i < entidade->tamanhoSpriteX; i++){
            for(int j=0; j < entidade->tamanhoSpriteY; j++){
                uint16_t cor_pixel = entidade->sprite[i + (j*entidade->tamanhoSpriteX)];
                
                // Só desenha se não for a cor transparente
                if(cor_pixel != TRANSPARENTE){
                    setPix( entidade->posicaoX+i, entidade->posicaoY+j, cor_pixel);
                }
                // Se for TRANSPARENTE (0xF8FF), não desenha nada (mantém o fundo)
            }
        }

    }

    void processPlayerInput(Entidade* entidade){
        int direcaoX = 0;
        int direcaoY = 0;
        if(botaoApertado(BOTAO_0)){
            direcaoX += 1;
        }
        if(botaoApertado(BOTAO_1)){
            direcaoY += -1;
        }
        if(botaoApertado(BOTAO_2)){
            direcaoY += 1;
        }
        if(botaoApertado(BOTAO_3)){
            direcaoX += -1;
        }
        entidade->velX = direcaoX * 10;
        entidade->velY = direcaoY * 10;
    }

    void processaFisicaEntidade(Entidade* entidade){
        entidade->posicaoX += entidade->velX;
        entidade->posicaoY += entidade->velY;
        if (entidade->posicaoX > TAMANHO_MUNDO_X ) entidade->posicaoX = 0 - entidade->tamanhoSpriteX;
        if (entidade->posicaoX + entidade->tamanhoSpriteX < 0) entidade->posicaoX = TAMANHO_MUNDO_X;
    }

    typedef struct Mapa{
        Entidade** entidades;
        int quantidadeEntidades;
        Entidade player;
        int pontuacao1;
        int pontuacao2;

    } Mapa;

    void processaFisicaPlayer(Mapa* mundo){
        Entidade* player = &mundo->player;
        player->posicaoX += player->velX;
        player->posicaoY += player->velY;

        // Se chegar no final do jogo, teleporta pra baixo e soma pontuação
        if (player->posicaoY < 15){
            player->posicaoY = 230;
            mundo->pontuacao1 += 1;
            
        }
        // Pra impedir que fuja da tela
        if (player->posicaoX + player->tamanhoSpriteX > TAMANHO_MUNDO_X ) player->posicaoX = TAMANHO_MUNDO_X - player->tamanhoSpriteX;
        if (player->posicaoX < 0) player->posicaoX = 0;
        if (player->posicaoY + player->tamanhoSpriteY > TAMANHO_MUNDO_Y ) player->posicaoY = TAMANHO_MUNDO_Y - player->tamanhoSpriteY;

    }

    void desenharEntidades(Entidade** entidades, int quantidadeEntidades){
        for(int i=0;i<quantidadeEntidades;i++){
            if(entidades[i] == NULL) continue; 
            desenharEntidade(entidades[i]);
        }
    }

    Entidade* criarEntidade(Mapa* mundo){
        int indiceLivre = -1;
        for(int i=0; i < mundo->quantidadeEntidades; i++){
            if(mundo->entidades[i] == NULL){
                indiceLivre = i;
                break;
            }
        }
        if(indiceLivre == -1) return NULL; 

        Entidade* novaEntidade = (Entidade*) malloc(sizeof(Entidade));
        mundo->entidades[indiceLivre] = novaEntidade;
        novaEntidade->posicaoX = rand() % TAMANHO_MUNDO_X;
        novaEntidade->posicaoY = rand() % TAMANHO_MUNDO_Y;
        novaEntidade->velX = 0;
        novaEntidade->velY = 0;
        novaEntidade->sprite = TubaraoRosaSprite;
        novaEntidade->tamanhoSpriteX = 20;
        novaEntidade->tamanhoSpriteY = 10;
        return novaEntidade;
    }

    void removerEntidade(Mapa* mundo, int indice){
        if(mundo->entidades[indice] == NULL) return;
        free(mundo->entidades[indice]);
        mundo->entidades[indice] = NULL;
    }   

    void processaFisicaMundo(Mapa* mundo){
        // - Aplicar velocidade na posição das entidades
        for(int i=0; i < mundo->quantidadeEntidades; i++){

            if(mundo->entidades[i] == NULL) continue;
            processaFisicaEntidade(mundo->entidades[i]);

        }
        // - Calcular colisão entre entidades e player
        for(int i=0; i < mundo->quantidadeEntidades; i++){
            if(mundo->entidades[i] == NULL) continue;

            Entidade* entidade = mundo->entidades[i];
            if(!(entidade->posicaoX > mundo->player.posicaoX + mundo->player.tamanhoSpriteX ||
            entidade->posicaoX + entidade->tamanhoSpriteX < mundo->player.posicaoX ||
            entidade->posicaoY > mundo->player.posicaoY + mundo->player.tamanhoSpriteY ||
            entidade->posicaoY + entidade->tamanhoSpriteY < mundo->player.posicaoY)) {

                mundo->player.posicaoY = 230;
            }
        }

    }


    // Nova função para spawnar entidades
    // Essa função deve conter a logica de QUANDO e ONDE as entidades devem aparecer
    void inicializarEntidades(Mapa* mundo){
        mundo->quantidadeEntidades = 10;
        mundo->entidades = (Entidade**) malloc(mundo->quantidadeEntidades * sizeof(Entidade*));
        for(int i=0;i<10;i++){
            mundo->entidades[i] = NULL;
        }

        // Daqui pra baixo
        for(int i = 0; i < 10; i++){
            Entidade* novaEntidade = criarEntidade(mundo);
            // Colocar entidade na posição correta
            
            novaEntidade->posicaoY = 35 + (20*i) - (novaEntidade->tamanhoSpriteY / 2);
            if (i < 5){
                novaEntidade->posicaoX = 310;
                novaEntidade->velX = -i;
                novaEntidade->sprite = TubaraoAzulSpriteF;
            }
            else{
                novaEntidade->posicaoX = 10;
                novaEntidade->velX = i;
            }
            // Alterar velocidade pra correta
        }
    }


